import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";


import styles from "assets/jss/material-kit-react/views/componentsSections/basicsStyle.js";
import socialStyle from "assets/css/socials.css";
const useStyles = makeStyles(styles);

export default function ContactSection() {
  const classes = useStyles();


  return (
    <div style={{background:"linear-gradient(to bottom, rgb(238, 238, 238), white 100%)"}} className={classes.sections}>
      <div className={classes.container}>
        <div className={classes.title}>
          <h2><b>Contact Information</b></h2>
          <hr  style={{borderTop:"1px solid #bbb", borderRadius:"5px"}}/>
        </div>
        <div style={socialStyle}>
        <ul>
            <li><a href="https://www.facebook.com/profile.php?id=100012512077239"><i class="fa fa-facebook" aria-hidden="true"></i></a></li>
            <li><a href="#"><i class="fa fa-twitter" aria-hidden="true"></i></a></li>
            <li><a href="#"><i class="fa fa-google-plus" aria-hidden="true"></i></a></li>
            <li><a href="https://www.linkedin.com/in/raj-kumar-web-designer/"><i class="fa fa-linkedin" aria-hidden="true"></i></a></li>
            <li><a href="#"><i class="fa fa-instagram" aria-hidden="true"></i></a></li>
            </ul>
        </div>

            </div> 
        </div>
  );
}
